INSERT INTO `light_up_card` (`light_up_card_id`, `picture`, `content`, `light_up_card_status`) VALUES
(9, 'card212.png', '<p><strong>NOT A CORPORATION? No problem!&nbsp;</strong></p><p>Send us your art our way, and we will show you how we can amplify it even more!&nbsp;</p><p>Mass production available so you can continue profiting with your followers.&nbsp;</p><p><strong><br></strong></p>', 'enable'),
(10, '10.jpg', '<p><strong>RENTALS</strong></p><p>Not looking for something custom, but looking to add to your day? Check out our rental inventory here!&nbsp;</p>', 'enable'),
(11, 'custom-neons-for-business-orlando-ofwgiftshop_com-7.jpg', '<p><strong>ARE YOU LARGER THAN LIFE?</strong></p><p>We\'re totally here for it. We can make our custom signs as large as your space can allow. Contact us for more information on how we can create something out of this world for you!&nbsp;</p>', 'enable'),
(12, 'Custom_Neon_Logo_Orlando_-ofwgiftshop_com_____.jpg', 'PRINT &amp; LIT&nbsp;', 'disable');
INSERT INTO `light_up_content` (`light_up_content_id`, `sub_heading`, `text`, `light_up_content_status`, `main_heading`) VALUES
(1, 'Indoor & Outdoor Customized Signs for Businesses', 'Looking for LED neon outdoor signs for your business? We offer waterproof / weatherproof signage. All of our outdoor neon business signs are UV resistant and come with a 12-month manufacturer\'s warranty.  So go ahead, call the pool boy and let him know the Cabana sign is on its way! ', 'enable', 'Neon Business Signs'),
(2, 'Light Up at Home or on the Fly ✈️', 'With a wide range of experience – we have created multiple signs for local businesses to fortune 500 companies known globally! \r\n\r\nYour vision is our mission to create a sign that personifies your brand as closely as possible. \r\n\r\nLED Neon is the modern take on an old school art form. Lucky for you, we are able to keep the old school feel with a modern-day mentality, allowing you to fly into Orlando for a tradeshow or conference, arrive to your backdrop with your fully custom-made sign glowing in all its glory, and by the end of your incredible event, you can pack it up as your carry on, without a fear that it will shatter to its final destination. \r\n  \r\nNo wires, wo worries! Our LED signs are made seamless, so they\'re no fuss and user friendly and easy to reuse.  It\'s as simple as plugging in a lamp at your home. We include the power source, a remote, and of course your sign with your order. Everything you need to get lit right from the comfort of your cubical or skyscraping office !\r\n\r\nNot looking for your logo but have a hashtag or brand slogan you want in your brands favorite font? Upload your idea below, it can be as simple as a screenshot of a drawing, a handwritten signature or a pdf with your desired phrase. You upload it, and we will give you the best options for your creation! ', 'enable', 'Corporate LED Neon Signs'),
(3, 'Neon Business Signs', 'Looking for LED neon outdoor signs for your business? We offer waterproof / weatherproof signage. All of our outdoor neon business signs are UV resistant and come with a 24 month manufacturer\'s warranty. Our LED flex neon signs conform to CE, RoHS and UL certification.', 'disable', 'Outdoor Neon Signs'),
(4, 'The Ordering Process', 'Step 1:  Fill out the form above and upload your current jpeg or pdf that you would like us to work with.\r\nStep 2: We will reach out to you with in 24-72 business hours with a response which includes the price options\r\nStep 3: Send us your revision requests or if you\'re ready, you can check out online! \r\n\r\nTimeframe:  If you\'re a corporation flying into Orlando, understand that we try and make magic happen, but we need at least 10-14 business days to make it happen for you. \r\n', 'enable', 'I\'m Ready! So what\'s the process?');
INSERT INTO `light_up_first_section` (`light_up_first_section_id`, `heading`, `content`, `light_up_first_section_status`) VALUES
(1, 'Custom Neon Light For Your Business', '<div class=\"row justify-content-center text-center\">\r\n                <div class=\"col-12\">\r\n                    <p>An LED neon light is the best way to light up your event! Create something custom for your staff or followers to snap, like tag and enjoy at your homestead or add it to your Orlando Tradeshow Booth Decor to set the vibe and attract your tribe in a picture perfect way!&nbsp;</p><p><br></p><p>We can create it and ship it to you direct, or have our staff add it to your event decor for a sweat free delivery and stunning results.&nbsp;</p>\r\n                </div>\r\n               <div class=\"col-md-3 upload-cards mx-md-4 py-5 px-4\">\r\n                            <h3>I WANT TO DESIGN MY OWN SIGN</h3>\r\n                            <a href=\"#uploading_f\" class=\"btn theme-btn des-btn\">Design Your Own</a>\r\n                        </div>\r\n                        <div class=\"col-md-3 upload-cards mx-md-4 py-5 px-4\">\r\n                            <h3>I HAVE AN IMAGE OR LOGO</h3>\r\n                            <a href=\"#uploading_f\" class=\"btn theme-btn des-btn\">Light It Up</a>\r\n                        </div>\r\n                        <div class=\"col-md-3 upload-cards mx-md-4 py-5 px-4\">\r\n                            <h3>I NEED A QUOTE ON MY SIGN IDEA</h3>\r\n                            <a href=\"#uploading_f\" class=\"btn theme-btn des-btn\">Quick Qoute</a>\r\n                        </div>\r\n            </div>', 'enable');
INSERT INTO `light_up_first_section` (`light_up_first_section_id`, `heading`, `content`, `light_up_first_section_status`) VALUES
(2, 'Make it Print & Lit!', '<p><img src=\"https://www.canva.com/design/DAFYt9XojEA/g4qDezoKjMXo8yJrOGvUdQ/edit?utm_content=DAFYt9XojEA&amp;utm_campaign=designshare&amp;utm_medium=link2&amp;utm_source=sharebutton\" alt=\"\" style=\"width: 300px;\">Our Print &amp; Lit Signs©️ are perfect for the Corporation seeking to keep brand integrity with their colors and all-around company vibe. With your company\'s brand colors completely printed on the acrylic and outlined in LED, this is the best way to keep your sign looking sharp whether its ON or OFF!&nbsp;</p><p><br></p><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 300px;\"></p>', 'enable');
